func Test_Tag(t *testing.T) {
	subDiv1 := T("div", A{"id": "sub-div-01", "class": "sub-title", "disabled": nil}, Text(">>>Su<<<bDivText"))
	subDiv2 := T("div", A{"id": "sub-div-02", "class": "sub-title"}, Text("SubDivText"))
	subDiv3 := T("div", A{"id": "sub-div-03", "class": "sub-title"}, Text("SubDivText"))
	div := T("div", A{"id": "div-01", "class": "title"}, subDiv1, subDiv2, subDiv3)

	fmt.Println(div)
}

func Test_Div(t *testing.T) {
	sd1 := Div(A{"id": "sub-div-01", "class": "sub-title", "disabled": nil}, Text(">>>Su<<<bDivText"))
	sd2 := Div(A{"id": "sub-div-02", "class": "sub-title"}, Text("SubDivText"))
	d := Div(A{"id": "div-01", "class": "title"}, sd1, sd2)
	fmt.Println(d)
}

func Test_Select(t *testing.T) {
	options := []TAG{
		T("option", A{"value": "value-01", "selected": false}, Text("option value 1")),
		T("option", A{"value": "value-02", "selected": true}, Text("option value 2")),
		T("option", A{"value": "value-03", "selected": false}, Text("option value 3")),
	}
	fmt.Println(T("select", options))
}

